var tipuesearch = {"pages": [{'title': 'Brython', 'text': '', 'tags': '', 'url': 'Brython.html'}, {'title': 'UK flag', 'text': '\n \n', 'tags': '', 'url': 'UK flag.html'}, {'title': 'ROC flag 90度反轉', 'text': '在這份作業中，我將ROC flag的程式碼複製進去，在將畫布的長寬數值對調便能達到轉90度的效果，在將青天的x、y數值做無數次的微調，最後試出了將x值加兩百便能達到貼其最右邊的效果，之後重複此步驟，將十二道白光芒、白日白心、白日藍圈的x值都加兩百，便能達到作業需求。 \n 導入 brython.js 程式庫 \n \n 導入 brython_stdlib.js 標準程式庫 \n \n 啟動 brython \n \n 執行所需要的 Brython 程式 \n \n \n', 'tags': '', 'url': 'ROC flag 90度反轉.html'}, {'title': '長200寬一百的紅色長方形', 'text': '這份作業是我們開始遠距離上課的第一份作業，作業內容是要我們做一個常200寬100的紅色長方形，我是先將導入啟動Bryson的程式碼複製到blogger的html裡，在將RUN裡的ROC flag前半段這至畫布的程式碼複製貼上，接著將長寬改成長200寬100，就完成此作業了，這份作業讓我學到如何在blogger裡繪製圖形，以及如何在blogger裡導入且啟動bryson。 \n \xa0 \n 導入 brython.js 程式庫 \n \n 導入 brython_stdlib.js 標準程式庫 \n \n 啟動 brython \n \n 執行所需要的 Brython 程式 \n \n \n', 'tags': '', 'url': '長200寬一百的紅色長方形.html'}, {'title': '本課程心得', 'text': '在此課程中，我原本以為很無聊就只是在學一些無聊的程式語言，但我錯了，我在此課程中，不僅學到了blogger的編輯，以及在blogger上繪圖，還有proxy的網路設定，甚至還有編輯倉儲以及如何將動態網頁轉成靜態網頁，我們還有約晚上去電腦教室拆解電腦，了解電腦的硬碟裝置，這些都非常有趣，而且都是動手做的，讓我非常有成就感，也學習到了許多我從未聽過的單詞，以及網頁設計，這門課老師也非常風趣，且有耐心地跟我們解釋以及分析課程內容，所以這堂課真的讓我受益良多，謝謝老師。 \n', 'tags': '', 'url': '本課程心得.html'}, {'title': '俄羅斯方塊', 'text': '\xa0 \n \n \n \n', 'tags': '', 'url': '俄羅斯方塊.html'}]};